import React from 'react'
import {Header} from './headerStyle'

class header extends React.Component{
    constructor(){
        super()
        this.state = {}
    }

    render(){
        return(
            <Header>
                <h1>Halo</h1>
            </Header>
        )
    }
}

export default header
